import React from "react";
import "./App.css";
import Nav from "../nav/Nav";
import Footer from "../footer/Footer";
import HomePage from "../homePage/HomePage";
import ContactUsPage from "../contactUsPage/ContactUsPage";

function App() {
  return (
    <div className="App">
      <Nav />
      {/* <HomePage /> */}
      <ContactUsPage />
      <Footer />
    </div>
  );
}

export default App;
